import { 
  RECEIVE_SELECTED_ASSET
} from "./asset.actions";

const INITIAL_STATE = {
}

// eslint-disable-next-line import/no-anonymous-default-export
const assetData = (state = INITIAL_STATE  , { type, assetData }) => {

  let flatObj = 'No object yet';

  if (assetData) {
    flatObj = Object.assign(
      {}, 
      ...function _flatten(o) { 
        return [].concat(...Object.keys(o)
          .map(k => 
            typeof o[k] === 'object' ?
              _flatten(o[k]) : 
              ({[k]: o[k]})
          )
        );
      }(assetData)
    )
    }

  console.log(`
  TYPE: ${type},  
  ASSET_DATA: ${flatObj}`);


  switch (type) {
    case RECEIVE_SELECTED_ASSET:
      return assetData;
    default:
      return state;
  }
};

export default assetData;
